import Tab from 'react-bootstrap/Tab';
import Tabs from 'react-bootstrap/Tabs';

// Icons
import {
  MdOutlineDashboardCustomize,
  MdOutlineSettings,
  MdOutlineMessage,
} from "react-icons/md";
function FillExample() {
    return (
      <Tabs
        defaultActiveKey="tab1"
        id="fill-tab-example"
        className="mb-3"
        fill
      >
        <Tab eventKey="tab1" title="<MdOutlineDashboardCustomize />">
            <small>Tab1content</small>
        </Tab>
        <Tab eventKey="tab2" title="<MdOutlineDashboardCustomize />">
        <small>Tab2content</small>
        </Tab>
        <Tab eventKey="tab3" title="<MdOutlineDashboardCustomize />">
        <small>Tab3content</small>
        </Tab>

      </Tabs>
    );
  }
  
  export default FillExample;
